import React from "react";

function StudentDashboard() {
  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold mb-4">Student Dashboard</h1>
      {/* TODO: List courses, select, submit, show status, conflict warnings */}
      <p>Welcome! Here you can view and register for courses.</p>
    </div>
  );
}

export default StudentDashboard;
